import './css-components/navbar.css';
import logo from '../assets/logos/gc-logo.png';

function Navbar() {
	return (
		<div>
			<div className="container">
				<div className="img_wrapper">
					<img src={logo} alt="GC Logo"/>
				</div>
				<div className="nav_items">
					<ul>
						<li></li>
					</ul>
				</div>
			</div>
		</div>	
	);
}

export default Navbar;
